import React from "react";
import { TextField } from "monday-ui-react-core"

const ListInput = () => {

        return (
            <div className="container">
                <div className="row">
                    <TextField className="col" type="text" placeholder="Enter a batch name" />
                </div>
                <div className="row">
                    <TextField className="col" type="number" placeholder="Enter a batch count" />    
                </div>
            </div>
        );
}

export default ListInput
